import '../../css/test.css';
const Test = () => {

    return (
        <nav id="navbar-row"  class="navbar navbar-expand-lg">
            <a class="navbar-brand" href="something">Navbar</a>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div class="navbar-nav">
            <a class="nav-item nav-link active" href="something">Home <span class="sr-only">(current)</span></a>
            <a class="nav-item nav-link" href="something">Features</a>
            <a class="nav-item nav-link" href="something">Pricing</a>
          </div>
        </div>
      </nav>
    )
}

export default Test;
